import axios from './axios'

export const getMenu = (param) => {
    return axios.request({
        url: '/permiss/getMenu',
        methods: 'post',
        data: param
    })
}
export const getData = () => {
    return axios.request({
        url: '/home/getData',

    })
}
export const getUser = (params) => {
    return axios.request({
        url: '/user/getUser',
        method: 'get',
        params
    })
}
